import React from 'react';
export default {

    tableHeader: (props) => {
        let o = Object.keys(props[0]);
        return o.map((key)=>{
                return <th key={key}>{key.toUpperCase()}</th>
                })
    },

    tableRow: (props) =>{
            let propsData = props;
            let rowData = Object.values(props[0]);
            return propsData.map((row,index)=>{
                return <tr key={index}><td >{rowData}</td></tr>
                // <tr>{ Object.values(row)}</tr>
                })

    }

}
